import React from 'react';
import { Grid, Card, CardContent, Typography, Button } from '@material-ui/core';
import logo from '../../resource/404.png';
import Style from './styles';

const Nopage = (props) => {
  const classes = Style();

  return (
    <Grid
	  container
	  direction="row"
	  justify="center"
	  alignItems="center">

	  <Grid item xs={5}>
	  	<Card className={classes.root}>
	  		<CardContent>
	  			<img src={logo} alt="error" />
	  			<Typography variant='h4' component='h2' className={classes.titulo}>
	  				Pagina no encontrada
	  			</Typography>
	  			<Typography variant='body1' component='h2' className={classes.subtitulo}>
	  				Errro en tu consulta la pagina que buscas no se esta disponible.
	  			</Typography>
	  			<Button
	  			className={classes.button}
	  			variant="outlined" 
	  			color="primary">
	  				Regresar al inicio
	  			</Button>
	  		</CardContent>
	  	</Card>
	  </Grid>

    </Grid>
  )
}

export default Nopage;
